import React from 'react';

const PasswordForm = () => {
    return (
        <>
            <h2 className="text-2xl font-semibold text-gray-700 mb-6">Đổi mật khẩu</h2>
            <form className="space-y-6" onSubmit={(e) => e.preventDefault()}>
                <div>
                    <label className="block mb-1">Mật khẩu hiện tại</label>
                    <input type="password" className="w-full border px-4 py-2 rounded" />
                </div>
                <div>
                    <label className="block mb-1">Mật khẩu mới</label>
                    <input type="password" className="w-full border px-4 py-2 rounded" />
                </div>
                <div>
                    <label className="block mb-1">Xác nhận mật khẩu mới</label>
                    <input type="password" className="w-full border px-4 py-2 rounded" />
                </div>
                <button className="bg-blue-600 text-white px-6 py-2 rounded hover:bg-blue-700">Đổi mật khẩu</button>
            </form>
        </>
    );
};

export default PasswordForm;
